from collections import defaultdict


class Solution(object):
	def numSubarraysWithSum(self, A, S):
		"""
		:type A: List[int]
		:type S: int
		:rtype: int
		"""
		if not A:
			return 0
		n = len(A)
		i = 0
		j = 0
		res = 0
		temp_sum = 0
		while i < n :
			if temp_sum != S:
				temp_sum += A[j]
				j += 1
				continue
			if temp_sum == S:
				res += 1
		return res

	def numSubarraysWithSum1(self, A, S):
		if not A:
			return 0
		print(sum(A))
		if sum(A) < S:
			return 0
		n = len(A)
		res = 0
		for i in range(n):
			temp = 0
			for j in range(i,n):
				temp += A[j]
				# print(temp)
				if temp < S:
					continue
				elif temp == S:
					res += 1
				elif temp > S:
					break
		return res

	def numSubarraysWithSum2(self, A, S):
		lookup = defaultdict(lambda : 0)
		temp = 0
		res = 0
		for a in A:
			lookup[temp] += 1
			temp += a
			res += lookup[temp-S]
		return res


